import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import LoginComp from "./loginComp";
import AdminDashboard from './AdminDashboard';
import AnnounceResults from './AnnounceResults';
import EditEvent from './EditEvent';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="/login" element={<LoginComp />} /> {/* Corrected path */}
      <Route path="/admin-dashboard" element={<AdminDashboard />} /> {/* New route for AdminDashboard */}
      <Route path="/add-new-event" component={AdminDashboard} />
      <Route path="/edit-existing-event" component={EditEvent} />
      <Route path="/admin/announce-results" component={AnnounceResults} />
    </Routes>
  </BrowserRouter>
);

reportWebVitals();
